import { Navigate } from "react-router-dom";
import type { RouteObject } from "react-router-dom";
import { lazy } from "react";

const BasicLayout = lazy(() => import("@/layouts/BasicLayout"));
const UserLayout = lazy(() => import("@/layouts/UserLayout"));
const Login = lazy(() => import("@/pages/user/Login"));
const Dashboard = lazy(() => import("@/pages/dashboard"));
const Roles = lazy(() => import("@/pages/permission/roles"));
const Resources = lazy(() => import("@/pages/permission/resources"));
const CategoryTypes = lazy(() => import("@/pages/category/types"));
const Categories = lazy(() => import("@/pages/category/list"));

const routes: RouteObject[] = [
  {
    path: "/",
    element: <BasicLayout />,
    children: [
      {
        path: "",
        element: <Navigate to="/dashboard" replace />,
      },
      {
        path: "dashboard",
        element: <Dashboard />,
      },
      {
        path: "permission",
        children: [
          {
            path: "roles",
            element: <Roles />,
          },
          {
            path: "resources",
            element: <Resources />,
          },
        ],
      },
      {
        path: "category",
        children: [
          {
            path: "types",
            element: <CategoryTypes />,
          },
          {
            path: "list",
            element: <Categories />,
          },
        ],
      },
    ],
  },
  {
    path: "/user",
    element: <UserLayout />,
    children: [
      {
        path: "login",
        element: <Login />,
      },
    ],
  },
  {
    path: "*",
    element: <Navigate to="/404" replace />,
  },
];

export default routes;
